import React from 'react';
import { useNavigate } from 'react-router-dom';
import Logo from '../../pictures/Logo.png';
import Dashboard from './Dashboard';

function AdminHome() {
    const navigate = useNavigate();

    const logout = async () => {
        try {
            localStorage.removeItem('token');
            // Redirect to the home page
            navigate('/');
        } catch (error) {
            console.error('Error during logout:', error);
        }
    };

    return (
        <div className="container-fluid" style={{ backgroundColor: '#3d3c3c' }}>
            <div className="row align-items-center">
                <nav className="navbar navbar-expand-lg navbar-light">
                    <div className="col-sm d-flex align-items-center ps-5">
                        <img src={Logo} className="d-inline-block align-top" alt="" style={{ height: '7%', width: '7%' }} />
                    </div>
                    <div className="col-sm-3 d-flex justify-content-end" style={{ paddingRight: '20px' }}>
                        <button type="button" className="btn btn-danger" onClick={logout}>
                            Log Out
                        </button>
                    </div>
                    <div className="col-lg-2 col-md-6">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Card 1</h5>
              <p className="card-text">Some text for card 1.</p>
            </div>
          </div>
        </div>
        <div className="col-lg-2 col-md-6">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Card 2</h5>
              <p className="card-text">Some text for card 2.</p>
            </div>
          </div>
        </div>
        <div className="col-lg-2 col-md-6">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Card 3</h5>
              <p className="card-text">Some text for card 3.</p>
            </div>
          </div>
        </div>
        <div className="col-lg-2 col-md-6">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Card 4</h5>
              <p className="card-text">Some text for card 4.</p>
            </div>
          </div>
        </div>
                </nav>
            </div>
            <div className="row align-items-center">
                <Dashboard />
            </div>
        </div>
    );
}

export default AdminHome;
